import React, { Component } from 'react'
import queryString from 'query-string';
export default class Local extends Component {
    constructor(props){
        super (props);
        this.state = {
            id:'',
        };
    }
    componentDidMount() {
        let values = queryString.parse(this.props.location.local);
        console.log(values);
        
        this.setState({ 
                id:values.id
            }
        )
    }
    render() {
        return (
            <div className="local">
                <p>{this.state.id}</p>
            </div>
        )
    }
}
